import './index.css'

const DiseasesItems=(props)=>{
    const {diseaseList}=props
    const {diseaseImg,name}=diseaseList
    return(
        <li className='disease-card'>
            <img className='card-image' src={diseaseImg} alt='disease-image' />
            <p className='disease-name'>{name}</p>
            <button className='button' onClick={this.viewDetails}>View</button>
        </li>
    )
}

export default DiseasesItems
